      // \u8FD9\u91CC\u901A\u8FC7\u7B2C\u4E8C\u4F4D\u53C2\u6570 input \u53EF\u62FF\u5230 deps \u7684\u8FD4\u56DE\u503C\u5E76\u590D\u7528
      fn: (draft, [a, b]) => draft.retA = a + b,
